/**
 * 关键词过滤，当碰到关键词太长时，preg_match方法将报warning并失效。
 * 此方法通过将过长的关键词分割为更小的部分，对每个子部分进行正则匹配来解决关键词过长的问题。
 */
header("Content-type:text/html;charset=utf-8");
function _filter($filter, $subject){
	$str = str_replace(array(']', '/', '*', '(', ')', '+', '?', '{', '}', '.', '^', '$'), array('\]', '\/', '\*', '\(', '\)', '\+', '\?', '\{', '\}', '\.', '\^', '\$'), $str);
	$len = strlen($filter);
	$i = 1;
	$arr = array();
	$start = 0;
	$offset = 0;
	while ($offset<$len){
		$offset = 10000*$i;
		if ($offset>$len){
			$str_tmp = substr($filter, $start, ($len-$start));
			$arr[] = $str_tmp;
			break;
		}else{
			$pos = strpos($filter, '|', $offset);
			$str_tmp = substr($filter, $start, ($pos-$start));
			$arr[] = $str_tmp;
	
			$start = $pos+1;
			$i++;
		}
	}
	$status = 1;
	foreach ($arr as $k=>$v){
		preg_match('/'.$v.'/', $subject, $matches);
		if (!empty($matches) && !empty($matches[0])){
			$status = 0;
			break;
		}
	}
	return $status;	
}

